    "2016-08-04T08:18:40.367948",nt"name": "refuge-narrative-report-january-1-to-april-30-1963-clarence-rhode-national-wildlife-range",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Clarence Rhode
    National Wildlife Range outlines Refuge accomplishments from January through April
    of 1963. The report begins by summarizing the weather conditions and habitat conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, raptors, fish, and disease- is also covered. The Refuge
    development and maintenance section discusses physical developments and collections
    and receipts. The public relations section of the report describes Refuge visitors,
    Refuge participation, violations, and safety. Items of interest and photographs
    are attached.",nt"license_title": "License Not Specified",nt"extras":
